package ManishLokesh.Neptune.v1.PNRService.PnrResponse;public class TrainResponse {    private String trainNo;    private String name;    private String boarding;    private String destination;    private String dt;    @Override    public String toString() {        return "TrainResponse{" +                "trainNo='" + trainNo + '\'' +                ", name='" + name + '\'' +                ", boarding='" + boarding + '\'' +                ", destination='" + destination + '\'' +                ", dt='" + dt + '\'' +                '}';    }    public String getTrainNo() {        return trainNo;    }    public void setTrainNo(String trainNo) {        this.trainNo = trainNo;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getBoarding() {        return boarding;    }    public void setBoarding(String boarding) {        this.boarding = boarding;    }    public String getDestination() {        return destination;    }    public void setDestination(String destination) {        this.destination = destination;    }    public String getDt() {        return dt;    }    public void setDt(String dt) {        this.dt = dt;    }}